import React from 'react';

function One() {
    return (
        <div>
            <h1>First Blog - Software Development with AI</h1>
            <p></p>
            <p>
                This is my first blog for CS480, Software Development with AI. This week, I've been tasked with reading Isaac Asimov's <a href="https://ia600806.us.archive.org/20/items/TheFeelingOfPower/The%20Feeling%20of%20Power.pdf">The Feeling of Power.</a>
            </p>
        </div>
    );
}

export default One;
